/// videoErrno
public enum OpenAPIVideoErrno: Int, OpenAPIErrnoProtocol {
    // 用户取消
    case UserCanceled = 1
    // 从系统相册中选择的图片或视频为空
    case EmptyMedia = 2
    // 从系统相册中选择的视频为空
    case EmptyVideo = 3
    // 视频时长超出可选取的最大时长
    case OverMaxDuration = 4
    // 抱歉，由于你所在组织的安全配置，该文件不能被保存到本地
    case SecurityPermissionDenied = 10
    // 不支持的视频格式
    case VideoFormatNotSupported = 11
    // 系统保存视频失败
    case UnableToSaveVideo = 12
    // 开始拍摄硬件资源抢占失败（有更高优先级业务占用）
    case startShootHigherPriorityFailed = 13

    public var bizDomain: Int { 13 }
    public var funcDomain: Int { 1 }
    
    public var errString: String {
        switch self {
        case .UserCanceled:
            return "User canceled the operation"
        case .EmptyMedia:
            return "Empty image or video"
        case .EmptyVideo:
            return "Empty video"
        case .OverMaxDuration:
            return "Video duration exceeds the maximum limit"
        case .SecurityPermissionDenied:
            return "Unable to save locally due to your organization's security configuration"
        case .VideoFormatNotSupported:
            return "Video format not supported"
        case .UnableToSaveVideo:
            return "Unable to save video"
        case .startShootHigherPriorityFailed:
            return "Unable to capture video, as the resources required are currently in use"
        }
    }
}
